// src/pages/LandingPage.js
import { Link } from 'react-router-dom';
import CustomNavbar from './CustomNavbar';
import './LandingPage.css';
import logo from '../assets/logo.png'; // Update the path if needed

export default function LandingPage() {
  return (
    <div className="landing-container">
      <CustomNavbar />
      <div className="landing-content">
        <img src={logo} alt="Institution Logo" className="landing-logo" />
        <p className="welcome">Welcome to Faculty Research Dashboard</p>
        <h1 className="title">Track, Manage, and Document Research Publications</h1>
        <p className="description">
          A centralized platform for faculty members and the Research & Development (R&D) cell to streamline research submissions, monitor publications, and manage academic outputs efficiently.
        </p>

        <div className="button-group">
          <Link to="/faculty-login" className="login-btn">FACULTY LOGIN</Link>
          <Link to="/hod-login" className="login-btn">HOD LOGIN</Link>
          <Link to="/login" className="login-btn">R&D ADMIN LOGIN</Link>
          <Link to="/principal-login" className="login-btn">PRINCIPAL LOGIN</Link>
        </div>
      </div>
    </div>
  );
}
